import React, { Component } from "react";
import MainLayout from "../Layout/MainLayout";

class Home extends Component {
    render() {
        return (
            <MainLayout>
                <div className="logo"></div>
                <img src="../img/vindkastlogo.svg" width="250" />

            </MainLayout>
        )
    }
}

export default Home;
